'game/handleInput':function(){
define([
  './state',
  './createBodies',
  './createJSON/main',
  './utils/insideCanvas',
  'dojo/dom',
  'frozen/utils'
], function(state, createBodies, createJSON, insideCanvas, dom, utils){

  var MAX_POLY_SIDES = 10;
  var POINT_RADIUS = 4;

  var xdisp = dom.byId('xdisp');
  var ydisp = dom.byId('ydisp');

  var mp;

  return function(im){

    if(im.mouseAction.position){
      xdisp.innerHTML = im.mouseAction.position.x;
      ydisp.innerHTML = im.mouseAction.position.y;
    }

    // mouse pressed
    if(im.mouseAction.isPressed() && insideCanvas(im.mouseAction.startPosition, this) && !mp){
      mp = im.mouseAction.startPosition;
      0 && console.log('start ' + state.tool, mp);
      state.geometries.push(mp);
    }

    //mouse released
    if(!im.mouseAction.isPressed() && im.mouseAction.endPosition && mp){
      mp = im.mouseAction.endPosition;

      if(state.tool === 'polygon' && state.geometries.length !== MAX_POLY_SIDES && (state.geometries.length <= 1 || utils.distance(state.geometries[0], mp) > POINT_RADIUS)){
        mp = null;
        return;
      }

      state.geometries.push(mp);
      state.jsonObjs.push(createJSON[state.tool](state.geometries));
      createBodies();
      state.geometries = [];

      im.mouseAction.endPosition = null;
      mp = null;
    }
  };

});
},
'game/createBodies':function(){
define([
  './state',
  './Entities',
  './ui/getGravity',
  './ui/displayJSON',
  './ui/toggleUndo',
  'lodash',
  'dojo/dom-class',
  'frozen/box2d/Box'
], function(state, Entities, getGravity, displayJSON, toggleUndo, _, domClass, Box){

  var DYNAMIC_COLOR = 'rgba(0,255,0,0.4)';
  var ZONE_COLOR = 'rgba(255,0,0,0.2)';

  var geomId = 0;

  return function(){
    var errors = false;
    var gravity = getGravity();

    state.game.box = new Box({
      gravityX: gravity.x,
      gravityY: gravity.y
    });

    state.game.entities = {};

    var max = _.chain(state.jsonObjs).map(function(obj){
      var id = parseInt(obj.id, 10);
      return typeof id === 'undefined' || id === null || isNaN(id) ? -1 : id;
    }).max().value();

    if(max){
      geomId = max + 1;
    }

    _.forEach(state.jsonObjs, function(obj){
      if(!obj.staticBody && !obj.zone){
        obj.color = obj.color || DYNAMIC_COLOR;
      }
      if(obj.zone){
        obj.color = obj.color || ZONE_COLOR;
      }
      if(typeof obj.id === 'undefined' || obj.id === null){
        obj.id = geomId;
        geomId++;
      }

      if(!state.game.entities[obj.id]){
        var ent = new Entities[obj.type](obj);
        state.game.entities[obj.id] = ent;
        if(!obj.zone){
          state.game.box.addBody(ent);
        }
      } else {
        errors = true;
      }
    });

    if(errors){
      domClass.remove('duplicate-ids', 'hide');
    } else {
      domClass.add('duplicate-ids', 'hide');
    }

    displayJSON(state.jsonObjs);
    toggleUndo();
  };

});
},
